import mysql from 'mysql2/promise';
import bluebird from 'bluebird';
import bcrypt from 'bcryptjs';
import db from '../models/index'

const salt = bcrypt.genSaltSync(10);

const hashUserPassword = (userPassword) => {
    let hashPassword = bcrypt.hashSync(userPassword, salt);
    return hashPassword;
}

const createNewUser = async (email, password, username) => {
    let hashPassword = hashUserPassword(password)

    try {
        await db.User.create({
            email: email,
            password: hashPassword,
            username: username
        })
    } catch (err) {
        console.log(err)
    }
}

const deleteUser = async (id) => {
    await db.User.destroy({
        where: { id: id }
    })

}

const getUserById = async (id) => {
    let user = {}
    user = await db.User.findOne({where: {id: id} })
    return user;
    // const connection = await mysql.createConnection({
    //     host: 'localhost',
    //     user: 'root',
    //     database: 'jwt',
    //     Promise: bluebird,
    // });

    // try {
    //     const [row, fields] = await connection.execute('SELECT * FROM user WHERE id = ?', [id]);
    //     return row;
    // } catch (err) {
    //     console.log(err)
    // }
}

const updateUserInfor = async (email, username, id) => {
    const connection = await mysql.createConnection({
        host: 'localhost',
        user: 'root',
        database: 'jwt',
        Promise: bluebird,
    });

    try {
        const [row, fields] = await connection.execute('UPDATE user SET email = ?, username = ? WHERE id = ?', [email, username, id]);
        return row;
    } catch (err) {
        console.log(err)
    }
}

const getUserList = async () => {
    let users = []
    
    try {
        users = await db.User.findAll()
    } catch (err) {
        console.log(err)
    }

    return users
}

module.exports = {
    createNewUser, getUserList, deleteUser, getUserById, updateUserInfor
}

