        raw: true
    })

    currentName.find((item) => {
        if (item.name === name) {
            check = false
        }
    })

    return check
}

const updateGroup = async (data) => {
    try {
        let group = await db.Group.findOne({
            where: { id: data.id }
        })


        if (group) {
